import { Box, Typography, makeStyles } from '@material-ui/core';
import StockMarket from '../Assets/Images/StockMarket.jpg';
import StockMarketClosing from '../Assets/Images/trending.jpg';

const useStyles = makeStyles({
    component: {
        margin: 50,
        '& > *': {
            marginTop: 50
        }
    },
    image: {
        width: '50%',
        height: '50%'
    }
})

const Home = () => {
    const classes = useStyles();
    return (
        <Box className={classes.component}>
            <Typography variant="h4">Stock Market</Typography>
            <Box style={{display: 'flex'}}>
                <img src={StockMarket} className={classes.image} />
                <img src={StockMarketClosing} className={classes.image} />

            </Box>
        <p> This is Stock market demo project</p>
        </Box>

    )
}

export default Home;
